import React from 'react';
import Menu from './Menu';
import Link from 'next/link';
import '../css/bootstrap.css'

const Layout = ({ children }) => {
  return (
    <div className="d-flex" id="wrapper">
      
      <nav className="bg-light border-right" id="sidebar-wrapper">
        <div className="sidebar-heading">Parking</div>
        <div className="list-group list-group-flush">
          <Link href='/'>
            <a className="list-group-item list-group-item-action bg-light">Home</a>
          </Link>
          <Link href='/about'>
            <a className="list-group-item list-group-item-action bg-light">Sobre</a>
          </Link>
        </div>
      </nav>

      <div id="page-content-wrapper">
        ({children});
      </div>
    </div>
  );
};

export default Layout();
